  \"2016-07-27T22:19:47.556940\",\n\t\"name\": \"blitzen-valley-management-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The 64,000 acre Blitzen Valley unit of
  Malheur National Wildlife Refuge is not producing enough wildlife to meet the refuge's
  migratory bird objectives. The area suffers from four major problems (water management,
  carp, predators, vegetation management) which are limiting its potential as wildlife
  habitat. This document recommends progressive actions that can be taken to help
  correct problems and enhance wildlife production.\",\n\t\"license_title\": \"License
